import React, { useState } from 'react';
import { Grid, TextField, Button } from "@material-ui/core";
import { Container, Typography, Paper } from "@material-ui/core";
import Parkingslots from './Parkingslots';
import {  useDispatch } from "react-redux";
import { BOOK, EXIT } from "./actionTypes";
import parkingData from './parkingData'
import {
  bookingAction,
} from './actions';

const Bookingform = () => {
  const [formData, setFormData] = useState({
    vehicle_number:"",
    entry_time:"",
    number_slot:0,
    isBooked: true,
  });


  const handleFormInput = (e) =>{
    const {name,value} = e.target
    console.log(name,value)
    formData[name] = name === "number_slot" ? Number(value):value
    console.log(formData,"inside function form data")
    setFormData(formData)
  }

   if(BOOK === parkingData) {
      alert("Parking area full")
   }


  const dispatch = useDispatch();
  return (
    <Container style={{ padding: 16, margin: "auto", maxWidth: 800 }}>
      <Typography
        variant="h4"
        align="center"
        component="h1"
        style={{ padding: 16 }}
      >
        Parking Lot Management System !
      </Typography>
      <Grid>
        <Paper style={{ padding: 16 }}>
          <Grid container justify="flex-start" alignItems="center" spacing={2}>
            <Grid item xs={12}>
              <TextField
                label="Vehicle Number"
                color="secondary"
                variant="outlined"
                type="Text"
                name="vehicle_number"
                fullWidth
                onChange={handleFormInput}
              />
            </Grid>

            <Grid item xs={12}>
              <TextField
                label="Entry Time"
                color="secondary"
                variant="outlined"
                fullWidth
                type="time"
                name="entry_time"
                defaultValue="00:00:00"
                onChange={handleFormInput}
              />
            </Grid>


            <Grid item xs={12}>
              <TextField
                label="number_slot"
                color="secondary"
                variant="outlined"
                type="Number"
                name="number_slot"
                fullWidth
                onChange={handleFormInput}
              />
            </Grid>

            <Grid
              container
              justify="space-evenly"
              alignItems="center"
              style={{ padding: 16 }}
            >
              <Button variant="contained" color="primary" type="submit" onClick={() => dispatch(bookingAction(formData))}>
                Submit
              </Button>
              <Button variant="contained" color="secondary" type="button">
                Reset
              </Button>
            </Grid>
          </Grid>
        </Paper>
      </Grid>
      <Parkingslots /> 
    </Container>
  );
};


export default Bookingform;
